import React from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { login } from '@store/authentification/auth.slice';
import { Row, Col, Typography, Space } from 'antd';
import LoginForm from '../LoginForm/Login.form';
import { selectorAuth } from '@store/authentification/auth.slice';

const LoginPage = () => {
  const { Title } = Typography;
  const dispatch = useDispatch();
  const auth = useSelector(selectorAuth);

  const handleSubmit = values => {
    console.log('!!!!!!!!!!VAKUES', values);
    dispatch(login({ email: values.email, password: values.password }));
  };

  return (
    <>
      <Row justify='center'>
        <Col span={8}>
          <Space direction='vertical'>
            <Title>Login</Title>
          </Space>
          <LoginForm onSubmit={handleSubmit} />
          {auth.error && <div>{auth.error.message}</div>}
        </Col>
      </Row>
    </>
  );
};

export default LoginPage;
